const addTopic = (...args) => {
  const [
    topicId,
    forumId,
    iconId,
    topicAttachment,
    topicApproved,
    topicReported,
    topicTitle,
    topicPoster,
    topicTime,
    topicTimeLimit,
    topicViews,
    topicReplies,
    topicRepliesReal,
    topicStatus,
    topicType,
    topicFirstPostId,
    topicFirstPosterName,
    topicFirstPosterColor,
    topicLastPostId,
    topicLastPosterId,
    topicLastPosterName,
    topicLastPosterColor,
    topicLastPostSubject,
    topicLastPostTime,
    topicLastViewTime,
    topicMovedId,
    topicBumped,
    topicBumper,
    pollTitle,
    pollStart,
    pollLength,
    pollMaxOptions,
    pollLastVote,
    pollVoteChange,
  ] = args;

  topics.push({
    topicId,
    forumId,
    topicTitle,
    // topicPoster,
    topicTime,
    topicViews,
    topicReplies,
    topicStatus,
    // topicFirstPostId,
    topicFirstPosterName,
    topicFirstPosterColor,
    // topicLastPostId,
    // topicLastPosterId,
    topicLastPosterName,
    topicLastPosterColor,
    // topicLastPostSubject,
    topicLastPostTime,
    // topicLastViewTime,
  });
};

